package com.fis.fw.core.entity;import javax.persistence.*;import java.util.Date;@Entity@Table(name="LOG_ACTION", schema = "ADMIN_DTHGD")public class LogAction {    private static final long serialVersionUID = 1L;    @Id    @Column(name = "LOG_ACTION_ID")    @GeneratedValue(strategy = GenerationType.SEQUENCE, generator = "LOG_ACTION_SEQ")    @SequenceGenerator(schema = "ADMIN_DTHGD", sequenceName = "LOG_ACTION_SEQ", name = "LOG_ACTION_SEQ", allocationSize = 1)    private Integer logsId;    @Column(name = "SESSION_ID")    private Integer sessionId;    @Column(name = "PRIVILEGE_ID")    private String privilegeId;    @Column(name = "CREATE_TIME")    private Date createTime;    @Column(name = "MENU_ID")    private String menuId;    @Column(name = "APP_CODE")    private String appCode;    @Column(name = "DESCRIPTION")    private String description;    @Column(name = "USER_ID")    private Integer userId;    @Column(name = "REQUEST_PAIR")    private String requestPair;    public Integer getLogsId() {        return logsId;    }    public void setLogsId(Integer logsId) {        this.logsId = logsId;    }    public Integer getSessionId() {        return sessionId;    }    public void setSessionId(Integer sessionId) {        this.sessionId = sessionId;    }    public String getPrivilegeId() {        return privilegeId;    }    public void setPrivilegeId(String privilegeId) {        this.privilegeId = privilegeId;    }    public Date getCreateTime() {        return createTime;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public String getMenuId() {        return menuId;    }    public void setMenuId(String menuId) {        this.menuId = menuId;    }    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }    public Integer getUserId() {        return userId;    }    public void setUserId(Integer userId) {        this.userId = userId;    }    public String getRequestPair() {        return requestPair;    }    public void setRequestPair(String requestPair) {        this.requestPair = requestPair;    }    public String getAppCode() {        return appCode;    }    public void setAppCode(String appCode) {        this.appCode = appCode;    }}